CREATE TABLE SKILL_CONTRIBUTIONS (
	ID INTEGER NOT NULL,
	POSITION_ID INTEGER NOT NULL,
	SKILL_ID INTEGER NOT NULL,
	TEAM_PART_ID INTEGER NOT NULL,
	PERCENT_VALUE DECIMAL(5,2) NOT NULL,
	CENTRAL_OR_SIDE_FLAG VARCHAR(1),
	CREATED_BY VARCHAR(100) DEFAULT 'admin' NOT NULL,
	CREATION_DATE DATE DEFAULT CURRENT_DATE NOT NULL,
	LAST_UPDATED_BY VARCHAR(100) DEFAULT 'admin' NOT NULL,
	LAST_UPDATE_DATE DATE DEFAULT CURRENT_DATE NOT NULL,
	CONSTRAINT SKILL_CONTRIBUTIONS_PK PRIMARY KEY (ID),
	CONSTRAINT SKILL_CONTRIB_POSITION_FK FOREIGN KEY (POSITION_ID) REFERENCES POSITIONS(ID),
	CONSTRAINT SKILL_CONTRIB_SKILL_FK FOREIGN KEY (SKILL_ID) REFERENCES SKILLS(ID),
	CONSTRAINT SKILL_CONTRIB_TEAM_PART_FK FOREIGN KEY (TEAM_PART_ID) REFERENCES TEAM_PARTS(ID)
);

